@Override
public void onMatch(RelOptRuleCall call) {
  /** @see ConverterRule */
  RelNode rel = call.rel(0);
  if (rel.getTraitSet().contains(Convention.NONE)) {
    final RelNode converted = convert(rel);
    if (converted != null) {
      call.transformTo(converted);
    }
  }
}

